window.bookSummaryJSON = "Formerly of the 82nd Airborne Division, <i>New York Times</i> best-selling author John Ringo brings unmatched authenticity to his military science fiction. <p> When asubatomic physics experiment causes a massive explosion, interdimensional gateways open in Florida - and aliens pour out. Some intend to bring Earth to its knees. Others seem willing to help, but will annihilate the planet if Navy SEAL Command Master Chief Robert Miller can't stop the menace from spreading.</p>"; 
